import React from 'react'
import ReactDOM from 'react-dom'

const Hello = (props) => {
	return(
		<p> Hello to {props.name}! You are {props.age} years old. </p>
	)
}


const App = () => {

const time = new Date();
const name = "Default";
const age = 15;

return(
  <div>
    <h1>The time now is {time.toString()}</h1>
    <Hello name = "George" age = "20"/>
    <Hello name = {name} age = {age} />
  </div>
)
}

ReactDOM.render(<App />, document.getElementById('root'))
